import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <div className="footer">
      <div className="footer-content">
        <p>Connect with us:</p>
      </div>
      <div className="footer-bottom">
        <p>&copy; 2023 My Company, Inc. All rights reserved.</p>
      </div>
    </div>
  );
}

export default Footer;
